package com.neo.moretest.annotationtest;import org.springframework.context.annotation.Bean;import org.springframework.context.annotation.Configuration;@Configurationpublic class FullConfig {    @Bean    public User user(){        return new User();    }    @Bean    public String name(User user){        System.out.println("user.hashCode():"+user.hashCode());        System.out.println("user().hashCode():"+user().hashCode());        return "test";    }}